.title h1{font-size:3em;line-height:110%;color:#4a4b4c;padding-bottom:10px
}
.title .esp-hr{padding-top:10px;padding-bottom:10px
}
.title hr{background:#0081FF;height:10px;border-radius:20px;width:100px;border:none;margin:0 auto
}
.esp-hr{padding-top:10px;padding-bottom:20px
}
hr{background:#0081FF;height:5px;border-radius:20px;width:100px;border:none
}
.container-faq{padding-top:100px;background:#0079EF;color:#fff;padding-bottom:50px;background:url(../assets/images/bg-01.svg),#0079EF;background-size:100%;background-repeat:repeat-y;background-attachment:fixed
}
.block-faq{width:600px;max-width:90%
}
button.btn{line-height:50px;height:50px;border:none;min-width:250px;color:#fff;font-size:1.2em;font-weight:900;border-radius:25px;cursor:pointer;-webkit-transition:.2s;-o-transition:.2s;transition:.2s;outline:none
}
h1{font-size:2.5em;line-height:110%;padding-bottom:20px
}
p{font-size:1.2em
}
@media screen and (max-width: 480px){
h1{font-size:2em !important
}
p{font-size:1em !important
}
}
[v-cloak]{display:none
}
.page-enter-active,.page-leave-active{-webkit-transition:opacity .5s;-o-transition:opacity .5s;transition:opacity .5s
}
.page-enter,.page-leave-active{opacity:0
}
.dialog-footer{padding:0 0px 15px 0px
}
